import React from 'react';
import "./Hero.css";
import hero from '../images/'


function Hero () {
    return (
      <div className='hero'>
        <div className='container'>
          <div className='row'>
            <div className='col-sm-12 col-md-6'>
              This is from hero area left
            </div>
            <div className='col-sm-12 col-md-6'>
              <img src={hero} alt=""/>
            </div>
          </div>
        </div>
      </div>
    );
}
export default Hero;
